import React from 'react';

function App() {
  const largeRadius = 50; // Radius of the larger circle
  const smallRadius = largeRadius * 0.75; // Radius of the smaller circle

  return (
    <div style={{ position: 'relative', textAlign: 'center', marginTop: '60px' }}>
      {/* Larger Circle */}
      <div
        style={{
          width: `${2 * largeRadius}px`, // Diameter of the larger circle
          height: `${2 * largeRadius}px`, // Diameter of the larger circle
          backgroundColor: 'blue',
          borderRadius: '50%', // Creates a circle
          border: '5px solid black', // Black border
          margin: 'auto',
        }}
      />

      {/* Smaller Circle */}
      <div
        style={{
          width: `${2 * smallRadius}px`, // Diameter of the smaller circle
          height: `${2 * smallRadius}px`, // Diameter of the smaller circle
          backgroundColor: 'green',
          borderRadius: '50%', // Creates a circle
          position: 'absolute', // Position it relative to the parent
          top: `${largeRadius - smallRadius}px`, // Correct centering
          left: `${largeRadius - smallRadius}px`, // Correct centering
          border: '3px solid black', // Optional: add a border to the smaller circle
        }}
      />
    </div>
  );
}

export default App;
